import React, { useContext, useEffect, useState } from "react";
import { Link, useParams } from "react-router-dom";
import { Context } from "../Context";
import Navbar from "../Navbar";
import Loading from "./Loading";
import { makeStyles } from "@material-ui/core/styles";
import ListSubheader from "@material-ui/core/ListSubheader";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import Collapse from "@material-ui/core/Collapse";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import DraftsIcon from "@material-ui/icons/Drafts";
import SendIcon from "@material-ui/icons/Send";
import ExpandLess from "@material-ui/icons/ExpandLess";
import ExpandMore from "@material-ui/icons/ExpandMore";
import StarBorder from "@material-ui/icons/StarBorder";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";

const useStyles = makeStyles((theme) => ({
  root: {
    width: "100%",
    maxWidth: 800,
    backgroundColor: theme.palette.background.paper,
    margin: theme.spacing(5, 0, 5, 0),
  },
  nested: {
    paddingLeft: theme.spacing(4),
  },
  header: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(2, 2, 2, 2),
  },
}));

function Tenant() {
  //get tenantid from url
  const { tenantId } = useParams();
  //tenant state
  const [tenantState, setTenantState] = useState();
  const [open, setOpen] = useState(false);
  //Context: getUserInfo method
  const { getUserInfo } = useContext(Context);

  const classes = useStyles();

  useEffect(() => {
    getUserInfo(tenantId)
      .then((response) => {
        console.log(response);
        setTenantState(response.data);
      })
      .catch(() => {
        console.log("Failed to retrieve tenant info");
      });
  }, []);

  const handleClick = () => {
    setOpen(!open);
  };

  return (
    <div>
      {tenantState ? (
        <div>
          <Navbar />
          <Box className={classes.header} textAlign="center">
            <Typography variant="h5">{tenantState.store_name}</Typography>
          </Box>
          <List
            component="nav"
            aria-labelledby="nested-list-subheader"
            className={classes.root}
          >
            <ListItem button divider={true}>
              <ListItemIcon>
                <SendIcon />
              </ListItemIcon>
              <ListItemText primary="Sent mail" />
            </ListItem>
            <ListItem button divider={true}>
              <ListItemIcon>
                <DraftsIcon />
              </ListItemIcon>
              <ListItemText primary="Drafts" />
            </ListItem>
            <ListItem button onClick={handleClick} divider={true}>
              <ListItemIcon>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Inbox" />
              {open ? <ExpandLess /> : <ExpandMore />}
            </ListItem>
            <Collapse in={open} timeout="auto" unmountOnExit>
              <List component="div" disablePadding>
                <ListItem button className={classes.nested}>
                  <ListItemIcon>
                    <StarBorder />
                  </ListItemIcon>
                  <ListItemText primary="Starred" />
                </ListItem>
              </List>
            </Collapse>
          </List>

          <Link to={`/tenant/fbChecklist/${tenantId}`}>Conduct Audit</Link>
        </div>
      ) : (
        <Loading />
      )}
    </div>
  );
}

export default Tenant;
